CREATE TABLE `items_for_sale` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) DEFAULT NULL,
  `community_id` text,
  `item_name` varchar(100) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `description` varchar(500) DEFAULT NULL,
  `seller_name` varchar(50) DEFAULT NULL,
  `seller_email` varchar(50) DEFAULT NULL,
  `seller_contact` varchar(15) DEFAULT NULL,
  `price` varchar(100) DEFAULT NULL,
  `status` enum('draft','sold','onSale') DEFAULT 'draft',
  `latitude` varchar(50) DEFAULT NULL,
  `longitude` varchar(50) DEFAULT NULL,
  `isDeleted` enum('0','1') DEFAULT '0',
  `created_on` datetime DEFAULT NULL,
  `modified_on` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=120 DEFAULT CHARSET=latin1;
